function showImages(genre) {
    var favgamesheader = document.querySelector('.favgamesheader');
    var imageSlots = document.getElementById('image-slots');

    // Limpiar slots anteriores
    imageSlots.innerHTML = '';

    // Verificar si el gnero tiene imgenes definidas
    if (genreImages[genre]) {
        // Generar nuevos slots para imgenes
        genreImages[genre].forEach(function(imageUrl) {
            if (imageUrl) { // Verificar si la URL no est vaca
                var slot = document.createElement('div');
                slot.className = 'image-slot';

                var img = document.createElement('img');
                img.src = imageUrl;
                slot.appendChild(img);

                imageSlots.appendChild(slot);
            }
        });
    } else {
        imageSlots.innerHTML = 'No images available for this genre.';
    }

    // Agrandar el div
    favgamesheader.classList.add('expanded');
}

